import PropTypes from 'prop-types';
import React, { useEffect, useState } from "react"
import { withTranslation } from "react-i18next"
import { Link } from "react-router-dom"
import {
    Table,
    Card,
    CardBody,
    Pagination,
    PaginationItem,
    PaginationLink,
    CardFooter,
    Button,
    Row,
    Col,
} from "reactstrap"
import ApiServicesDetalleDocumentacion from '../../../../services/DocumentacionLegal/ApiServicesDetalleDocumentacion';
import { BpmServices, BackendServices } from "../../../../services";
import { useLocation, useHistory } from "react-router-dom";
import * as url from "../../../../helpers/url_helper"
import SweetAlert from "react-bootstrap-sweetalert"
import { AvField, AvForm, AvGroup } from 'availity-reactstrap-validation';
import Switch from "react-switch";
import { useTranslation } from 'react-i18next';
import Currency from '../../../../helpers/currency';

const Offsymbol = () => {
    return (
        <div
            style={{
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                height: "100%",
                fontSize: 12,
                color: "#fff",
                paddingRight: 2,
            }}
        >
            {" "}
            No
        </div>
    );
};
const OnSymbol = () => {
    return (
        <div
            style={{
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                height: "100%",
                fontSize: 12,
                color: "#fff",
                paddingRight: 2,
            }}
        >
            {" "}
            Si
        </div>
    );
};
const estiloTotales = { backgroundColor: "lightgrey !important", color: "black !important", textAlign: "center" }
const RegistroPublico = (props) => {
    const [switch1, setswitch1] = useState(false);
    const [switch2, setswitch2] = useState(false);
    const [switch3, setswitch3] = useState(false);
    const [switch4, setswitch4] = useState(false);
    const [switch5, setswitch5] = useState(false);
    const [switch6, setswitch6] = useState(false);
    const [switch7, setswitch7] = useState(false);
    const [switch8, setswitch8] = useState(false);
    const [switch9, setswitch9] = useState(false);
    const [switch10, setswitch10] = useState(false);
    const [switch11, setswitch11] = useState(false);
    const [switch12, setswitch12] = useState(false);
    const [total, settotal] = useState(0);
    const { t, i18n } = useTranslation();
    const currencyData = new Currency();
    const apiServiceBackend = new BackendServices();
    const location = useLocation()
    const [openModalRiesgo, setopenModalRiesgo] = useState(false);
    const [dataRows, setdataRows] = useState(null);
    const [messageNotAvailable, setmessageNotAvailable] = useState(false);
    const [locationData, setLocationData] = useState(location.data);
    const history = useHistory();
    React.useEffect(() => {
        let dataSession;
        if (location.data !== null && location.data !== undefined) {
            if (location.data.transactionId === undefined || location.data.transactionId.length <= 0) {
                history.push(url.URL_DASHBOARD);
            } else {
                sessionStorage.setItem('locationData', JSON.stringify(location.data));
                setLocationData(location.data);
                dataSession = location.data;
            }
        } else {
            //chequeamos si tenemos guardado en session
            var result = sessionStorage.getItem('locationData');

            if (result !== undefined && result !== null) {
                result = JSON.parse(result);
                setLocationData(result);
                dataSession = result;
            }
        }

    }, [!locationData]);
    function check() {
        let check1 = document.getElementById("check1") ? document.getElementById("check1").checked : false;
        let check2 = document.getElementById("check2") ? document.getElementById("check2").checked : false;
        let check3 = document.getElementById("check3") ? document.getElementById("check3").checked : false;
        let check4 = document.getElementById("check4") ? document.getElementById("check4").checked : false;
        let check5 = document.getElementById("check5") ? document.getElementById("check5").checked : false;
        let check6 = document.getElementById("check6") ? document.getElementById("check6").checked : false;
        let check7 = document.getElementById("check7") ? document.getElementById("check7").checked : false;
        let check8 = document.getElementById("check8") ? document.getElementById("check8").checked : false;
        let check9 = document.getElementById("check9") ? document.getElementById("check9").checked : false;
        let check10 = document.getElementById("check10") ? document.getElementById("check10").checked : false;
        let check11 = document.getElementById("check11") ? document.getElementById("check11").checked : false;
        let check12 = document.getElementById("check12") ? document.getElementById("check12").checked : false;
        let jsonValues = {
            value1: 0,
            value2: 0,
            value3: 0,
            value4: 0,
            value5: 0,
            value6: 0,
            value7: 0,
            value8: 0,
            value9: 0,
            value10: 0,
            value11: 0,
            value12: 0
        }
        if (check1 == true) {
            jsonValues.value1 = document.getElementById("value1").value == "" ? 0 : currencyData.getRealValue(document.getElementById("value1").value);
        }
        if (check2 == true) {
            jsonValues.value2 = document.getElementById("value2").value == "" ? 0 : currencyData.getRealValue(document.getElementById("value2").value);
        }
        if (check3 == true) {
            jsonValues.value3 = document.getElementById("value3").value == "" ? 0 : currencyData.getRealValue(document.getElementById("value3").value);
        }
        if (check4 == true) {
            jsonValues.value4 = 50;
        }
        if (check5 == true) {
            jsonValues.value5 = 25;
        }
        if (check6 == true) {
            jsonValues.value6 = 25;
        }
        if (check7 == true) {
            jsonValues.value7 = 8;
        }
        if (check8 == true) {
            jsonValues.value8 = 31;
        }
        if (check9 == true) {
            jsonValues.value9 = 10;
        }
        if (check10 == true) {
            jsonValues.value10 = 25;
        }
        if (check11 == true) {
            jsonValues.value11 = 50;
        }
        if (check12 == true) {
            jsonValues.value12 = 35;
        }
        settotal(() => {
            return parseFloat(jsonValues.value1) + parseFloat(jsonValues.value2) + parseFloat(jsonValues.value3) + parseFloat(jsonValues.value4) + parseFloat(jsonValues.value5) + parseFloat(jsonValues.value6) + parseFloat(jsonValues.value7) + parseFloat(jsonValues.value8) + parseFloat(jsonValues.value9) + parseFloat(jsonValues.value10) + parseFloat(jsonValues.value11) + parseFloat(jsonValues.value12);
        })
    }
    return (
        <React.Fragment>
            <AvForm>
                <Row>
                    <Col md="12">
                        <div className="table-responsive styled-table-div">
                            <Table className="table table-striped table-hover styled-table table">
                                <thead>
                                    <tr style={{ textAlign: "center" }}>
                                        <td>Tipo de trámite</td>
                                        <td>Précio establecido</td>
                                        <td>Habilita</td>
                                    </tr>
                                </thead>
                                <tbody>
                                    <tr>
                                        <td>Venta de finca</td>
                                        <td><AvField pattern="^[0-9,.]*$"
                                            onKeyUp={(e) => {
                                                let x = currencyData.getRealValue(e.target.value); e.target.value = currencyData.format(x); setTimeout(() => {
                                                    check()
                                                }, 1000);
                                            }} type="text" className="form-control" name="value1" id="value1" /></td>
                                        <td>
                                            <AvGroup check className="mb-3">
                                                <Switch name="isPresentationEnvironmentalPermitsNecessary"
                                                    uncheckedIcon={<Offsymbol />}
                                                    checkedIcon={<OnSymbol />}
                                                    onColor="#007943"
                                                    id="check1"
                                                    className="form-label"
                                                    onChange={() => {
                                                        setTimeout(() => {
                                                            check()
                                                        }, 1000);
                                                        setswitch1(!switch1);
                                                    }}
                                                    checked={switch1}
                                                />
                                            </AvGroup></td>
                                    </tr>
                                    <tr>
                                        <td>Garantía Hipotecaria sobre Bien Inmueble</td>
                                        <td><AvField pattern="^[0-9,.]*$"
                                            onKeyUp={(e) => {
                                                let x = currencyData.getRealValue(e.target.value); e.target.value = currencyData.format(x); setTimeout(() => {
                                                    check()
                                                }, 1000);
                                            }} type="text" className="form-control" name="value2" id="value2" /></td>
                                        <td>
                                            <AvGroup check className="mb-3">
                                                <Switch name="isPresentationEnvironmentalPermitsNecessary"
                                                    uncheckedIcon={<Offsymbol />}
                                                    checkedIcon={<OnSymbol />}
                                                    onColor="#007943"
                                                    id="check2"
                                                    className="form-label"
                                                    onChange={() => {
                                                        setTimeout(() => {
                                                            check()
                                                        }, 1000);
                                                        setswitch2(!switch2);
                                                    }}
                                                    checked={switch2}
                                                />
                                            </AvGroup></td>
                                    </tr>
                                    <tr>
                                        <td>Fideicomiso de Garantía sobre Bien Inmueble</td>
                                        <td><AvField pattern="^[0-9,.]*$"
                                            onKeyUp={(e) => {
                                                let x = currencyData.getRealValue(e.target.value); e.target.value = currencyData.format(x); setTimeout(() => {
                                                    check()
                                                }, 1000);
                                            }} type="text" className="form-control" name="value3" id="value3" /></td>
                                        <td>
                                            <AvGroup check className="mb-3">
                                                <Switch name="isPresentationEnvironmentalPermitsNecessary"
                                                    uncheckedIcon={<Offsymbol />}
                                                    checkedIcon={<OnSymbol />}
                                                    onColor="#007943"
                                                    id="check3"
                                                    className="form-label"
                                                    onChange={() => {
                                                        setTimeout(() => {
                                                            check()
                                                        }, 1000);
                                                        setswitch3(!switch3);
                                                    }}
                                                    checked={switch3}
                                                />
                                            </AvGroup></td>
                                    </tr>
                                    <tr>
                                        <td>Calificación del Contrato de Fideicomiso</td>
                                        <td style={{ textAlign: "right" }}>$50.00</td>
                                        <td>
                                            <AvGroup check className="mb-3">
                                                <Switch name="isPresentationEnvironmentalPermitsNecessary"
                                                    uncheckedIcon={<Offsymbol />}
                                                    checkedIcon={<OnSymbol />}
                                                    onColor="#007943"
                                                    id="check4"
                                                    className="form-label"
                                                    onChange={() => {
                                                        setTimeout(() => {
                                                            check()
                                                        }, 1000);
                                                        setswitch4(!switch4);
                                                    }}
                                                    checked={switch4}
                                                />
                                            </AvGroup></td>
                                    </tr>
                                    <tr>
                                        <td>Calificación del Contrato de Préstamo</td>
                                        <td style={{ textAlign: "right" }}>$25.00</td>
                                        <td>
                                            <AvGroup check className="mb-3">
                                                <Switch name="isPresentationEnvironmentalPermitsNecessary"
                                                    uncheckedIcon={<Offsymbol />}
                                                    checkedIcon={<OnSymbol />}
                                                    onColor="#007943"
                                                    id="check5"
                                                    className="form-label"
                                                    onChange={() => {
                                                        setTimeout(() => {
                                                            check()
                                                        }, 1000);
                                                        setswitch5(!switch5);
                                                    }}
                                                    checked={switch5}
                                                />
                                            </AvGroup></td>
                                    </tr>
                                    <tr>
                                        <td>Calificación de Acta (por cada acta)</td>
                                        <td style={{ textAlign: "right" }}>$25.00</td>
                                        <td>
                                            <AvGroup check className="mb-3">
                                                <Switch name="isPresentationEnvironmentalPermitsNecessary"
                                                    uncheckedIcon={<Offsymbol />}
                                                    checkedIcon={<OnSymbol />}
                                                    onColor="#007943"
                                                    id="check6"
                                                    className="form-label"
                                                    onChange={() => {
                                                        setTimeout(() => {
                                                            check()
                                                        }, 1000);
                                                        setswitch6(!switch6);
                                                    }}
                                                    checked={switch6}
                                                />
                                            </AvGroup></td>
                                    </tr>
                                    <tr>
                                        <td>Marginal de Garantía (por cada finca)</td>
                                        <td style={{ textAlign: "right" }}>$8.00</td>
                                        <td>
                                            <AvGroup check className="mb-3">
                                                <Switch name="isPresentationEnvironmentalPermitsNecessary"
                                                    uncheckedIcon={<Offsymbol />}
                                                    checkedIcon={<OnSymbol />}
                                                    onColor="#007943"
                                                    id="check7"
                                                    className="form-label"
                                                    onChange={() => {
                                                        setTimeout(() => {
                                                            check()
                                                        }, 1000);
                                                        setswitch7(!switch7);
                                                    }}
                                                    checked={switch7}
                                                />
                                            </AvGroup></td>
